  <p class=MsoNormal><span lang=sv style='font-size:12.0pt;line-height:113%;
  font-family:Arial;language:sv'>Det är hög tid att lösa Ditt fortsatta medlemskap för 2010 nu !</span></p>
  <p class=MsoNormal><span lang=sv style='font-size:12.0pt;line-height:113%;
  font-family:Arial;language:sv'>Du förnyar enkelt genom att betala in avgiften till<br>
  </span><span
  lang=sv style='font-size:12.0pt;line-height:113%;font-style:italic;
  font-variant:small-caps;text-decoration:underline;font-weight:bold;
  language:sv'>Bankgiro</span><span lang=sv style='font-size:12.0pt;line-height:
  113%;color:black;font-style:italic;text-decoration:underline;font-weight:
  bold;language:sv'> 351-8198</span><span lang=sv style='font-size:12.0pt;
  line-height:113%;color:black;font-weight:bold;language:sv'>.</span><span
  lang=sv style='font-size:12.0pt;line-height:113%;font-family:Arial;
  color:black;language:sv'> (OBS! </span><span lang=sv style='font-size:12.0pt;
  line-height:113%;font-family:Arial;color:black;text-decoration:underline;
  language:sv'>Inte </span><span lang=sv style='font-size:12.0pt;line-height:
  113%;font-family:Arial;color:black;language:sv'>plusgirot.)</span></p>
  <p class=MsoNormal><span lang=sv style='font-size:12.0pt;line-height:113%;
  font-family:Arial;language:sv'>Huvudmedlem 300 kr<br>
  Familjemedlem 100 kr<br>
  Serviceavgift för utställare 50 kr<br>
  Serviceavgift för uppfödare 50 kr.</span></p>
  <p class=MsoNormal><span lang=sv style='font-size:12.0pt;line-height:113%;
  font-family:Arial;language:sv'>Glöm inte att anmäla ändrade adresser mm till klubben!</span></p>
  <p class=MsoNormal><span lang=sv style='font-size:12.0pt;line-height:113%;
  font-family:Arial;language:sv'>Medlemskap krävs för att kunna anmäla till utställning, registrera kattungar mm. </span></p>
  <p class=MsoNormal><span lang=sv style='font-size:12.0pt;line-height:113%;
  font-family:Arial;language:sv'>Dan</span></p>
